■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>簡単に固定できる強力ベルクロテープ！</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5004an-01.jpg" width="380" height="320"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">【ご使用上の注意】<br>●テープ面裏側の接着時には接着面の汚れをきれいに拭き取って下さい。<br>●接着は常室温状態で接着を行ってください。テープ表面(フック側とループ側供)に埃・ゴミなど、異物が入らないようにご注意願います。<br>●直射日光の当たる場所でのご使用はおやめください。<br>●重量物の単独取付は避けてください。重量物の取付けにご使用の際は必ずボルト固定やその他の方法を兼用してください。<br>●家具など大型の物にご使用の場合は充分な量をお使いください。<br>※ファルロックは地震などの振動にともなう機器の転倒や落下の抑制補助をするものです。地震などで生じた一切の損害に対して責任を負いかねますので予めご承知おきください。<br>※予告なく仕様および外観を変更する場合がありますので、ご了承ください。<br><br><br>引張強度：垂直方向56kg(5cmx20cmサイズ)、並行方向98kg(5cmx20cmサイズ)<br>適応可能接着材：ABS、アクリルシート、アルミニューム、セラミック、タイル、波状ボール紙、ガラス、塗装壁面、ラッカー合板、ポリカーポネイト、ポリエステル、ガラスファイバー、ポリエチレン、鉄鋼(表面未塗装)、硬質ビニール<br>使用用途：冷蔵庫、電子レンジ、パソコン、液晶テレビ、スチール、キャビネット、その他、家具など取り外しを頻繁に行わない機器などの固定に</font></td></tr></table><br><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5004an-02.jpg" width="600" height="653"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">家中のほとんどのモノが簡単に固定できる米国ベルクロ社が供給する超強力ベルクロ・ テープ。超強力ファルロックは、取り外しが少ない結合状況の下で優れた効果を発揮します。(注意：頻繁の取り外しには、適しません。)お好きな大きさに切って、ご自由にお使いください。　 </font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">家中のほとんどのモノが簡単に固定できる米国ベルクロ社が供給する超強力ベルクロ・ テープ。超強力ファルロックは、取り外しが少ない結合状況の下で優れた効果を発揮します。(注意：頻繁の取り外しには、適しません。)お好きな大きさに切って、ご自由にお使いください。　 </font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">5cm×20cm</font><br><font color="#333333" size="-1">個装サイズ：27×13×1cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">26g</font><br><font color="#333333" size="-1">個装重量：260g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ポリエステル・ポリプロピレン</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">米国</font></td></tr></table><!--スペックここまで--><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
